function openMenu(btn) {
  try {
    offcanvas.classList.add('is-active');
    backdrop.classList.add('is-active');
    btn.classList.add('is-active');
    document.body.classList.add('no-scroll');
  } catch (error) {
    console.log(`Ошибка в открытии меню: ${error}`);
  }
}

function closeMenu() {
  try {
    offcanvas.classList.remove('is-active');
    backdrop.classList.remove('is-active');
    toggleBtns.forEach((btn) => btn.classList.remove('is-active'));
    document.body.classList.remove('no-scroll');
  } catch (error) {
    console.log(`Ошибка в закрытии меню: ${error}`);
  }
}

toggleBtns.forEach((btn) => {
  btn.addEventListener('click', () => {
    if (offcanvas.classList.contains('is-active')) {
      closeMenu();
    } else {
      openMenu(btn);
    }
  });
});

window.addEventListener('scroll', () => {
  if (pageYOffset > 100) {
    fixedHeader.classList.add('is-visible');
    fixedNavbar.classList.add('show');
  } else {
    fixedHeader.classList.remove('is-visible');
    fixedNavbar.classList.remove('show');
  }
});

closeBtn.addEventListener('click', closeMenu);
backdrop.addEventListener('click', closeMenu);
